Sexsomnia - Alexis Texas, Aubrey Addams, Jynx Maze, Madison Ivy, Vicki Chase SPLIT SCENES

Sleep sex better known as &quot;Sexsomnia&quot;is a form of sleepwalking that causes people to engage in sexual acts while they are asleep. And while little has been known about it until now, the exciting new release &quot;Sexsomnia&quot; is poised to blow the lid off this condition with the help of some of the most acclaimed performers in adult entertainment. Who better to take you on this XXX journey than sleepy-eyed stunner Alexis Texas? This shapely bombshell has won eleven major awards since entering the industry, and she positively shines in her segment here. Blonde spinner Madison Ivy and AVN, XRCO and F.A.M.E. award nominee Aubrey Addams keep the sensual action moving, and the cast is fleshed out by such fan favorites as Vicki Chase and Jynx Maze. &quot;Sexsomnia&quot; It's sleep sex that's guaranteed to keep you wide awake in dreamland!
